import { axiosInstance } from "./AxiosInstance"

export const fetchAllMovies = async(data) =>{
    const token = localStorage.getItem('accessToken');
    try{
        if (token){
            const response = await axiosInstance.get("http://localhost:8888/homeMovies");
            return response.data;
        }
    }catch(err){
        console.log(err);
        return err.response.data;
    }
}

export const fetchMovieById = async(movieId) =>{
    try{
        const response = await axiosInstance.get(`http://localhost:8888/homeMovies/${movieId}`);
        return response.data;
    }catch(err){
        console.log(err);
        return err.response.data;
    }
}
